http://tarkusattacks.bandcamp.com/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://tarkusattacks.bandcamp.com/&lt;/a&gt;

either that or go see them when they play near you.. they travel the midwest, but not too often.

Disclaimer: I was told by Chris and Nate that I could put this up for download so don't be afraid... DL and share!


BTW.. they want to be defined as &quot;storming the castle&quot; rock
